import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MovieList = ({ editMovie, deleteMovie }) => {
  const [movies, setMovies] = useState([]); // Start with an empty array
  const [editingId, setEditingId] = useState(null);
  const [editedMovie, setEditedMovie] = useState({ Movie_Name: '', Description: '', Rating: '' });

  // Fetch movie data from the API when the component mounts
  useEffect(() => {
    axios.get('http://localhost:5001/movies') // Adjust the URL if needed
      .then((response) => {
        setMovies(response.data); // Update state with fetched movies
      })
      .catch((error) => {
        console.error("There was an error fetching the movies:", error);
      });
  }, []); // Empty array ensures this runs once, on mount

  const handleEdit = (movie) => {
    setEditingId(movie.id); // Set the movie we want to edit
    setEditedMovie(movie); // Pre-fill the edit form with the current movie data
  };

  const handleSave = () => {
    if (editedMovie.Movie_Name && editedMovie.Description && !isNaN(editedMovie.Rating)) {
      axios.put(`http://localhost:5001/movies/${editingId}`, editedMovie) // Send updated data to server
        .then(() => {
          // Update the movie in the local state after a successful API request
          const updatedMovies = movies.map((movie) =>
            movie.id === editingId ? { ...movie, ...editedMovie } : movie
          );
          setMovies(updatedMovies); // Update state
          setEditingId(null); // Exit editing mode
        })
        .catch((error) => {
          console.error("There was an error saving the movie:", error);
        });
    } else {
      alert("Please fill out all fields correctly.");
    }
  };

  const handleDelete = (id) => {
    axios.delete(`http://localhost:5001/movies/${id}`) // API call to delete movie
      .then(() => {
        // Remove the movie from the local state
        const updatedMovies = movies.filter((movie) => movie.id !== id);
        setMovies(updatedMovies);
      })
      .catch((error) => {
        console.error("There was an error deleting the movie:", error);
      });
  };

  const handleCancel = () => {
    setEditingId(null); // Exit editing mode without saving
    setEditedMovie({ Movie_Name: '', Description: '', Rating: '' }); // Reset form
  };

  return (
    <div>
      {movies.length > 0 ? (
        movies.map((movie) => (
          <div key={movie.id} className="movie-item">
            {editingId === movie.id ? (
              <div>
                <input
                  type="text"
                  value={editedMovie.Movie_Name}
                  placeholder="Movie Name"
                  onChange={(e) => setEditedMovie({ ...editedMovie, Movie_Name: e.target.value })}
                />
                <input
                  type="text"
                  value={editedMovie.Description}
                  placeholder="Description"
                  onChange={(e) => setEditedMovie({ ...editedMovie, Description: e.target.value })}
                />
                <input
                  type="number"
                  value={editedMovie.Rating}
                  placeholder="Rating"
                  onChange={(e) => setEditedMovie({ ...editedMovie, Rating: e.target.value })}
                />
                <button onClick={handleSave}>Save</button>
                <button onClick={handleCancel}>Cancel</button>
              </div>
            ) : (
              <div>
                <table>
                  <thead>
                    <tr>
                      <th>Movie Name</th>
                      <th>Description</th>
                      <th>Rating</th>
                      <th>Edit</th>
                      <th>Delete</th>
                    </tr>
                  </thead>
                  <tbody>
                    <tr>
                      <td>{movie.Movie_Name}</td>
                      <td>{movie.Description}</td>
                      <td>{movie.Rating}</td>
                      <td>
                        <button onClick={() => handleEdit(movie)}>Edit</button>
                      </td>
                      <td>
                        <button onClick={() => handleDelete(movie.id)}>Delete</button>
                      </td>
                    </tr>
                  </tbody>
                </table>
              </div>
            )}
          </div>
        ))
      ) : (
        <p>No movies to display.</p>
      )}
    </div>
  );
};

export default MovieList;
